import React from 'react';
import {Jumbotron,Container} from 'reactstrap';
import Menu from '../components/Menu';

function Home({data}) {
  return (
    <>
      <Menu />
      <Jumbotron fluid className="list"></Jumbotron>
      <h1>Minhas metas.</h1>
      <hr/>
      {
        data.metas.map(meta=>(
          
            <div key={meta._id}>
              <h2>{meta.name}</h2>
              <p>{meta.description}</p>
              <p>{meta.status}</p>
              <hr />
            </div>
          
        ))
      }

    </>
  )
}

export async function getServerSideProps(){
  try {
    const response = await fetch(`http://localhost:8080/metas`);
    const data = await response.json();
    console.log(data);
    return {props:{data}}
  } catch (error) {
    return {
      notFound: true,
      error: `Dados não encontrados ${error}`
    } 
  }
  
}
export default Home
